import React from "react";

function Note(props) {
  return (
    <div className="note">
      <h1 className="h1">{props.title}</h1>
      <p className="p">{props.content}</p>
      <button onClick={handleClick}>DELETE</button>
    </div>
  );
}

export default Note;
